CREATE TABLE `products` (
  `product_id` mediumint(4) unsigned NOT NULL auto_increment,
  `wholesale_price` varchar(100) default NULL,
  `retail_price` varchar(100) default NULL,
  `size` varchar(2) default NULL,
  `quantity_on_hand` mediumint(1),
  `brand` varchar(100) default NULL,
  `gender` varchar(7) default NULL,
  `season` varchar(10) default NULL,
  `clothing_type` varchar(20) default NULL,
  `color` varchar(20) default NULL,
  `supp_id` mediumint(8) unsigned NOT NULL,
  PRIMARY KEY (`product_id`)
) AUTO_INCREMENT=1;

